import Header from "./Header";
import SearchBar from "./SearchBar";
import List from "./List";

export default function HomePage(props) {
  return (
    <div
      className="homepage"
      style={{ display: "flex", flexDirection: "column", width: "40vw" }}
    >
      <Header />
      <SearchBar />
      <List />
    </div>
  );
}
